import React from 'react';

function About() {
  return (
    <section id="about" className="section">
      <h2>About Me</h2>
      <p>
        Hi, I'm [Your Name]. I'm a passionate [Your Role/Profession] with expertise in [Your Skills].
        I have [X] years of experience in [Your Industry/Field], and I enjoy [Something You're Passionate About].
        Feel free to explore my portfolio and get in touch!
      </p>
    </section>
  );
}

export default About;
